import React from "react";
import TopNavbar from "./components/TopNavbar";

function loginCheck() {
  const [session, loading] = useSession();
  const router = useRouter();

  useEffect(() => {
    if (session || loading) {
      router.push("/");
    }
  }, [session, loading]);
}

export default function Recipes() {
  return (
    <div>
      <TopNavbar />
      <h1>QUI VANNO IL FILTER E LE RICETTE</h1>
    </div>
  );
}
